import './App.css';
import { AuthProvider } from './context/AuthContext';
import HomePage from './pages/HomePage'
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage />} exact />
            <Route />
          </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
